        },
        {
            imageUrl: 'user.png',
            title: 'Advanced CSS and Sass',
            des: 'Learn new secrets to creating awesome Microsoft Access databases and VBA coding not covered in any of my other courses!',
            tag1: 'FULL TIME',
            tag2: 'DEVELOPER',
            tag3: '21 HOUR',
        },
        {
            imageUrl: 'user.png',
            title: 'Modern React with Redux',
            des: 'Learn new secrets to creating awesome Microsoft Access databases and VBA coding not covered in any of my other courses!',
            tag1: 'HALF TIME',
            tag2: 'DESINER',
            tag3: '5 HOUNRS',
        },
        {
            imageUrl: 'user.png',
            title: 'Node JS',
            des: 'Learn new secrets to creating awesome Microsoft Access databases and VBA coding not covered in any of my other courses!',
            tag1: 'HALF TIME',
            tag2: 'CODER',
            tag3: '45 MIN',
        },
        {
            imageUrl: 'user.png',
            title: 'Mobile Product Design',
            des: 'Learn new secrets to creating awesome Microsoft Access databases and VBA coding not covered in any of my other courses!',
            tag1: 'FULL TIME',
            tag2: 'DESINER',
            tag3: '30 MIN',
        },
    ];

        return (
            <Fragment>
                <div id="wrapper">
                    <Adminsidebar/>

                    <div id="content-wrapper" className="d-flex flex-column">
                        <div id="content">
                            <AdminTopnav/>
                            <div className="container px-3 py-4">
                                <div className="row mb-3">
                                    <div className="col-lg-12">
                                        <PageHeader
                                            className="site-page-header card bg-lightblue text-grey-900 fw-700 "
                                            onBack={() => window.history.back()}
                                            title="Data Guru / Tenaga Pengajar"
                                        />
                                    </div>
                                </div>

                            </div>


                            <Adminfooter/>
                        </div>
                    </div>
                </div>
            </Fragment>
        );
}

export default DataGuruAdmin;
